export function getAttachmentType(extension: string) {
  const booleans = {
    isImageMessage:
      /\.(jpe?g|png|gif|ico)$/i.test(extension) &&
      extension.includes("/upload/"),
    isAudioMessage:
      /\.(ogg|mp3|wav|m4a|webm)$/i.test(extension) &&
      extension.includes("/upload/"),
    isVideoMessage:
      /\.(mp4|avi)$/i.test(extension) && extension.includes("/upload/"),
    isFileMessage: true,
  };
  booleans.isFileMessage =
    !booleans.isAudioMessage &&
    !booleans.isImageMessage &&
    !booleans.isVideoMessage;
  return booleans;
}
